import React from 'react';
import styled from "styled-components";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

function Work() {

  let settings={
        dots:true,
        infinite:true,
        speed:500,
        slideToShow:1,
        slidesToScroll:1,
        autoplay:true
    }

  return (
    <Container {...settings}>

          <h1>WHAT I'VE DONE ?</h1>
          <Content>
          <Wrap>
                <a href="https://disneyclone789.web.app/" target="_blank"> <img src="/images/disney.jpg" alt="project" /></a>
              
  
          </Wrap>
          <Wrap>
          <a href="https://netflixdemo123-4b7ad.web.app/" target="_blank" ><img  src="/images/netflix.jpg" alt="project" /></a>
               
  
          </Wrap>
          <Wrap>
          <a href="https://tin-anime.vercel.app/" target="_blank"> <img src="/images/TA1.png" alt="project" /></a>
              

          </Wrap>
          
           </Content>

           <Content>
              <Wrap>
          <a href="https://nature-project.vercel.app/" target="_blank"> <img src="/images/nature.png" alt="project" /></a>
          </Wrap>
          <Wrap>
          <a href="https://nature-project.vercel.app/" target="_blank"> <img src="/images/nature.png" alt="project" /></a>
          </Wrap>
          <Wrap>
          <a href="https://nature-project.vercel.app/" target="_blank"> <img src="/images/nature.png" alt="project" /></a>
          </Wrap>     
           </Content>
        </Container>
  )
}


const Container=styled(Slider)`
  margin: 80px; 

  h1{
    margin-top: 10rem;
    color: white;
    font-weight:500;
    text-align: center;
    margin-bottom:7rem;
  }
   ul li button{
        &:before{
            font-size:10px;
            color:rgb(150,158,171);
        }
    }


    li.slick-active button:before{
        color:white;
    }

    .slick-list{
        overflow:visible;
    }

    button{
        z-index:1;
    }

`
 
const Content=styled.div`
     display:grid;
     grid-gap:10px;
    grid-template-columns: repeat(4, minmax(0, 1fr));
    @media (max-width: 768px) {
        display:flex;
        flex-direction: column;
      }

`

const Wrap=styled.div`
    border-radius:10px;
    cursor:pointer;
    overflow:hidden;
    position: relative;
    border: 3px solid rgba(249,249,249,0.1);
    box-shadow: rgba(0 0 0 / 69%) 0px 26px 30px -10px,
        rgba(0 0 0 / 73%) 0px 16px 10px -10px;
    transition: all 250ms cubic-bezier(0.25,0.46,0.45,0.94) 0s;    

    img{
        width:100%;
        height:100%;
        display: block;
        transition: opacity 500ms ease-in-out 0s;
        object-fit:cover;
    }

    &:hover{
        box-shadow: rgba(0 0 0 / 80%) 0px 40px 58px -16px,
        rgba(0 0 0 / 72%) 0px 30px 22px -10px;
        transform:scale(1.05);
        border-color: rgba(249,249,249,0.8);
    }
`


export default Work
